  // }  
  render(){
    //console.log(this.props.todos)
  return this.props.todos.map((todo) =>(
    <TodoItem key={todo.id} todo={todo} markComplete=
    {this.props.markComplete} delTodo={this.props.delTodo} />

  ));
}




}
